class Country {
  final String name;
  final String flag;
  final String code;
  final String dialCode;
  final String regionCode;
  final int minLength;
  final int maxLength;
  final List<States>? states;

  const Country({
    required this.name,
    required this.flag,
    required this.code,
    required this.dialCode,
    required this.minLength,
    required this.maxLength,
    required this.states,
    this.regionCode = "",
  });

  String get fullCountryCode {
    return dialCode + regionCode;
  }

  String get displayCC {
    if (regionCode != "") {
      return "$dialCode $regionCode";
    }
    return dialCode;
  }

  factory Country.fromJson(Map<String, dynamic> json) => Country(
        name: json["name"],
        flag: json["flag"],
        code: json["code"],
        dialCode: json["dialCode"],
        minLength: json["minLength"],
        maxLength: json["maxLength"],
        regionCode: json["regionCode"],
        states: json["states"] == null
            ? []
            : List<States>.from(json["states"]!.map((x) => States.fromJson(x))),
      );

  Map<String, dynamic> toJson() => {
        "name": name,
        "flag": flag,
        "code": code,
        "dialCode": dialCode,
        "minLength": minLength,
        "maxLength": maxLength,
        "regionCode": regionCode,
        "states": states == null
            ? []
            : List<dynamic>.from(states!.map((x) => x.toJson())),
      };
}

class States {
  String? name;
  List<String>? cities;

  States({
    this.name,
    this.cities,
  });

  factory States.fromJson(Map<String, dynamic> json) => States(
        name: json["name"],
        cities: json["cities"] == null
            ? []
            : List<String>.from(json["cities"]!.map((x) => x)),
      );

  Map<String, dynamic> toJson() => {
        "name": name,
        "cities":
            cities == null ? [] : List<dynamic>.from(cities!.map((x) => x)),
      };
}
